#
# 資料表格式： `fitness_data`
#

CREATE TABLE `fitness_data` (
  c_curr_seme varchar(4) NOT NULL default '',
  student_sn int(10) unsigned NOT NULL default '0',
  test1 int(10) default NULL,
  prec1 int(6) default NULL,
  test2 int(10) default NULL,
  prec2 tinyint(6) default NULL,
  test3 int(10) default NULL,
  prec3 tinyint(6) default NULL,
  test4 int(10) default NULL,
  prec4 tinyint(6) default NULL,
  age tinyint(6) default NULL,
  up_date datetime NOT NULL default '0000-00-00 00:00:00',
  tall int(10) default NULL,
  weigh int(10) default NULL,
  bmt tinyint(6) default NULL,
  test_y tinyint(6) default NULL,
  test_m tinyint(6) default NULL,
  prec_t tinyint(6) default NULL,
  prec_w tinyint(6) default NULL,
  prec_b tinyint(6) default NULL,
  teacher_sn int(10) default NULL,
  PRIMARY KEY (c_curr_seme,student_sn)
) ENGINE=MyISAM;

#
# 資料表格式： `fitness_mod`
#

CREATE TABLE `fitness_mod` (
  id bigint(10) NOT NULL auto_increment,
  grade tinyint(2) default 0,
  sex tinyint(1) default 0,
  age tinyint(2) default 0,
  p5 int(6) default 0,
  p10 int(6) default 0,
  p15 int(6) default 0,
  p20 int(6) default 0,
  p25 int(6) default 0,
  p30 int(6) default 0,
  p35 int(6) default 0,
  p40 int(6) default 0,
  p45 int(6) default 0,
  p50 int(6) default 0,
  p55 int(6) default 0,
  p60 int(6) default 0,
  p65 int(6) default 0,
  p70 int(6) default 0,
  p75 int(6) default 0,
  p80 int(6) default 0,
  p85 int(6) default 0,
  p90 int(6) default 0,
  p95 int(6) default 0,
  PRIMARY KEY (id)
) ENGINE=MyISAM;

